type Props = {
  data: {
    id: number;
    icon_class: string;
    title: string;
    link: string;
    link_text: string;
  };
};

export const ContactCart: FC<Props> = ({ data }) => {
  return (
    <div className={styles.cart}>
      <div className={styles.icon}>
        {/* <img src={data.icon} alt="" /> */}
        {/* <TimeIcon /> */}
        {/* <EmailIcon /> */}
        <span className={data.icon_class}>{data.icon}</span>
      </div>
      <div className={styles.text}>
        <h3>{data.title}</h3>
        <a href={data.link}>{data.link_text}</a>
      </div>
    </div>
  );
};
